// src/App.js
import React from 'react';
import Header from './components/Header';
import LoginForm from './components/LoginForm.tsx'; // Remove .tsx
import Hero from './components/Hero';
import LandingPage from './components/ProductivityLanding.js';
import WebsiteFooter from './components/WebsiteFooter'; // Remove .tsx
import ProgressTracker from './components/ProgressTracker';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <Router> {/* Wrap your app with Router */}
      <div className="App">
        <Header /> {/* Header is rendered here. */}
        <main>
          <Routes> 
            <Route path="/login" element={<LoginForm />} /> {/* /login route renders LoginForm */}
            {/* the component Hero , ProgressTracker and websiteFooter will be displayed in the path "/" */}
              <Route path="/" element={
              <>
              <Hero />
              <ProgressTracker />
              <WebsiteFooter />
              </>
            } />
          </Routes>
        </main>
      </div>
    </Router>
  );
};

export default App;
